import React from "react";
import Navbar from "./navmenu/Navbar";
import WorkExperience from "./timeline/WorkExperience";
import Contact from "./Contact";
import { Document } from "react-pdf";

const Resume = () => {
  return (
    <>
      <Navbar />
      <Document />
      <WorkExperience />
      <Contact />
    </>
  );
};

export default Resume;
